notes:
- Test management must be configured and already successfully authenticated.
- Providing the password directly via API can currently reveal the central password
  by reporting.
- Only for pseudo signals in trace analysis!
- Returns the parent protocol object if there is one present, otherwise None.
- '*Only for pseudo signals in trace analysis!*'
- Uses OAuth2 with refresh token  requires setup of connected app in api
- For non-verbose DLT messages, loading an appropriate Fibex file and using their
  individual signals is recommended.
- Ensure the API is properly set up for authentication
- These methods can only be used if access to a test management system has previously
  been configured manually for the current workspace.
- Will try a 'Basic' Authentication regardless of the configuration.
- Represents configuration change report items.
errors:
- '0: Ok'
- '1: Timeout in transport layer'
- '2: Received negative response'
- '3: No active diagnostics session'
- '4: Timeout waiting for diagnostics response'
- '5: Transmission error'
- '6: Unexpected response'
- '7: Still waiting for response'
- '8: Transport error'
- '9: Application error'
- '401 Unauthorized: Check your authentication credentials'
- '404 Not Found: Verify the endpoint path'
- 'exception: If a user adapter is currently active.'
- 'exception: Or the test management system is not configured.'
- 'exception: Or the user is not authenticated.'
auth_info:
  mentioned_objects:
  - Credentials
  - KeyStore
  - Secret
  - Certificate
  - PrivateKey
  - PublicKey
  - SeedAndKey
  - Authentication
  - AuthenticationConfigurationResult
  - AuthenticationResult
  - COMApplication
  - COMCache
  - COMPackage
  - COMProject
client:
